import React, { Component } from 'react';
import TeamMember from './TeamMember';

class Team extends Component {
	render() {
		const memberInfo = [
			{
				img: '/img/1.jpg',
				name: 'Dominic Purcell',
				position: '11111',
				phone: '3333333333333333333333',
				email: '999',
				website: '99'
			},

			{
				id: 3,
				img: '/img/2.jpg',
				name: 'Wentworth Miller',
				position: '6666',
				phone: '55555556214',
				email: '8jbkj'
			},

			{
				id: 2,
				img: '/img/3.jpg',
				name: 'Robin Tunney',
				position: 'vgcb50215',
				phone: '66666',
				email: 'kljbgdxk22',
				website: '5213mnn'
			},

			{
				id: 4,
				img: '/img/4.jpg',
				name: 'Peter Stormare',
				position: 'zdfgfhjgj',
				phone: '669999',
				email: 'dttyuyfiu47',
				website: 'sfhfdkhkh'
			},

			{
				id: 5,
				img: '/img/5.jpg',
				name: 'Sarah Wayne Callies',
				position: 'dy',
				phone: '55555',
				email: 'ohgcfxgvj',
				website: '6413132/.,kjhgf'
			},

			{
				id: 6,
				img: '/img/6.jpg',
				name: 'Amaury Nolasco',
				position: 'hjhjjty',
				phone: '55555',
				email: '84545132loji'
			}
		];
		const members = memberInfo.map((member) => (
			<TeamMember
				img={member.img}
				name={member.name}
				position={member.position}
				phone={member.phone}
				email={member.email}
				website={member.website}
			/>
		));

		return <div className="row">{members}</div>;
	}
}
export default Team;
